    "text": "Je prends la t\u00eate de l'assaut, et m\u00e8ne mes hommes au c\u0153ur du camp de l'ennemi. Autour du moi, les bandits se saisissent de leurs armes et s'\u00e9lancent \u00e0 notre rencontre, hurlant des chapelets d'injures. \r\nAu milieu de la m\u00eal\u00e9e, je transperce un forban alors que Girart tranche la gorge d'un autre qui voulait me prendre \u00e0 revers. \r\nMes soldats de fortunes se battent avec courage, et repoussent peu \u00e0 peu les ennemis. Du coin de l\u2019\u0153il, je vois Giefroi fendre les rangs adverse et affronter le chef des bandits en combat singulier. Sa lame d\u00e9vie un coup d'estoc, d\u00e9s\u00e9quilibrant le brigand. Giefroi pivote sur la gauche, et lui tranche la t\u00eate d'un seul revers! Les bandits contemplent, horrifi\u00e9s, le corps sans vie de leur chef s\u2019effondrer sur le sol. Bon nombre d'entre eux l\u00e2chent leurs armes et s'enfuient en courant...\r\n\r\n    \r\n    Giefroi gagne le trait Intrepide!\r\n", 
