    "text": "    -85 \u00e9cus\r\n\r\nAssis sur un tr\u00f4ne fra\u00eechement install\u00e9, je contemple d\u2019un \u0153il satisfait les r\u00e9parations que les ma\u00e7ons ont apport\u00e9 aux murs de la grande salle. Le toit demande encore quelques planches et l\u2019aile ouest du ch\u00e2teau n\u2019a toujours pas \u00e9t\u00e9 d\u00e9blay\u00e9e, mais les travaux avancent \u00e0 grands pas. Les serviteurs qui s\u2019aff\u00e8rent de toute part ont \u00e9t\u00e9 engag\u00e9s par Robin dans le village voisin, qui fr\u00e9mit toujours de la nouvelle du retour de ma famille. Notre argent est presque \u00e9puis\u00e9, et nous allons avoir grand besoin de l\u2019ob\u00e9issance de ces gueux. Notre nom et la lettre du roi seront des atouts pr\u00e9cieux, mais je devrais utiliser les \u00e9cus qui me reste pour mettre toutes les chances de notre c\u00f4t\u00e9...", 
