fields.text:
{% if title.tresorier != None %}
{{title.tresorier}}
{% else %}
{{fils}}
{% endif %} est venu me voir ce matin pour m’annoncer ce que je redoutais depuis un moment déjà : mes coffres sont presque vides. Les rapports étalés devant moi contiennent les chiffres des taxes que me payent les paysans, ainsi que ceux des dépenses du château, hommes d’armes, domestiques, repas, entretien... Remplir mes caisses prendra trop de temps, et j’ai besoin de solutions.

Le petit bataillon a atteint les terres du seigneur {%if tuto%}  {{tuto_adversaire}} {%else%} {{chatelain_defenseur}} {%endif%}à la tombée de la nuit, profitant  de l'obscurité pour traverser la rivière glacée sans attirer l'attention des sentinelles. Rassemblés autour de leurs maigres feux de camp, les hommes ont dormi quelques heures avant d'être réveillés par leurs officiers. Il se sont mit rapidement en formation, leurs mains crispées sur leurs armes. 
{% if chatelain_in_mission_attaquant %}Levant bien haut mon épée, j'ai
{% elif connetable_in_mission_attaquant %}Le soleil du matin brillant sur son heaume, sire{
{title.Connétable}} a
{% else %}D'une démarche martiale, sire {{general_attaquant}} a{% endif %}
 marché devant eux et déclaré d'une voix forte que l'ennemi avait été repéré à quelque lieues d'ici, et que le combat était imminent. Après un discours bref mais plein de morgue, les soldats ont crié mon nom à pleins poumons et se sont mit en mouvement.

La bataille était terminée, et les corbeaux apparaissaient un à un dans le ciel, poussant leurs  cris affamés sans  parvenir à couvrir le râle des blessés et des mourants. {{title.chatelain}} avait vaincu. Sur mes {{pop_envoyee_gagnant}} hommes d'arme, {{pop_pertes_vainqueur}} étaient tombés l'arme à la main, emportant avec eux {{pop_pertes_perdant}} ennemis vociférants et faisant fuir le reste.
{% if morts_gagnant|length >= 1 %}
Nous avions remporté une victoire, mais à quel prix? {{ morts_gagnant|folks_list}} 
{% if morts_gagnant|length == 1 %}
gisait aux milieu des cadavres, serrant encore son épée.
{% else %}
étaient tombés sans que les nôtres ne puissent leur porter secours.
{% endif %}
{% endif %}
{% if blesses_gagnant|length >= 1 %}
{{blesses_gagnant|folks_list}} avai{{blesses_gagnant|pluralize:"t,ent" }} été blessé{{blesses_gagnant|pluralize}} dans la bataille, et devrai{{blesses_gagnant|pluralize:"t,ent" }} être ramené{{blesses_gagnant|pluralize}} au château sur {{blesses_gagnant|pluralize:"une,des"}} litière{{blesses_gagnant|pluralize}}.
{% endif %}
{% if morts_perdants|length >= 1 %}
Chez l'adversaire, {{ morts_perdants|folks_list}} avai{{mort_perdants|pluralize:"t,ent" }} été terrassé.{{mort_perdants|pluralize}}
{% endif %} 
{% if blesses_perdants|length >= 1 %}
{% if morts_gagnant|length >= 1 %}
De plus,
{% endif %} 
{{ blesses_perdants|folks_list}} avaient été blessés et garderaient des cicatrice de cette bataille.
{% endif %}

{% if chatelain_in_mission_vainqueur %}
Chassant la fatigue qui me tenaillait, je rassemblai mes hommes valides pour{% elif connetable_in_mission_vainqueur %}
Sire {{general_vainqueur.first_name}} essuya son épée, et cria aux hommes de se regrouper pour
{% else %}
{{general_vainqueur}} entreprit de rallier les nôtres  pour 
{% endif %}
{% if vainqueur_est_attaquant %} procéder au pillage de {% if tuto %}  {{tuto_adversaire}} {% else %} {{perdant}} {% endif %}{% else %} entamer le repli vers le château.{% endif %}

Sur les {{pop_envoyee_perdant}} hommes d'armes qui s'étaient élancés dans la bataille, seuls {{pop_envoyee_perdant - pop_pertes_perdant }} avait réussir à s'enfuir, laissant le champ de bataille aux mains de l'ennemi. {{dynasty}} avait été battu
{% if morts_gagnant|length == 1 %}
et le corps de {{morts_perdants|folks_list}}, tombé au milieu des combats, avait du être laissé au main de l'ennemi.
{% elif morts_perdants|length >= 2 %}
, et {{morts_perdants|folks_list}} l'avaient payés de leur vie.
{% else %}.{% endif %}
{% if blesses_gagnant|length == 1 %}
{{blesses_perdants|folks_list}} avait été gravement touché, mais avait pu être porté hors des combats avant que le morale de mes troupes ne se brise.
{% elif morts_perdants|length >= 2 %}
{{morts_perdants|folks_list}} avaient encaissé plusieurs blessures, mais avaient réussit à suivre mes troupes en déroute.
{% endif %}{% if blesses_gagnant|length >= 1 %}Chez l'adversaire, {{blesses_perdants|folks_list}} avai{{blesses_gagnant|pluralize:"t,ent"}} été cruellement blessés dès le premier assaut. {% endif %}Les {{pop_pertes_gagnant}} soldats ennemis tués {% if morts_perdants|length >= 1 %}et la mort de {{mort_perdants|folks_list}}{% endif %} ne suffisaient pas à atténuer l'amertume de la défaite...
{% if chatelain_in_mission_perdant %}
Ravalant ma colère, je ralliai mes hommes en fuite{% elif connetable_in_mission_perdant %}
{{general_perdant.first_name}}, surmontant la fatigue qui le tenaillait, se redressa sur sa selle pour hurler aux hommes en fuite de se rassembler
{% endif %} pour entamer le retour au château.
{% if vainqueur_est_attaquant %} {% if tuto %}{{tuto_adversaire}}{% else %}{{gagnant}}{% endif %} allait pouvoir mettre mes terres à sac en toute impunité.{% endif %}

Tard le soir, {{title.maitre_espion.first_name}} a frappé à ma porte. "...En tant que votre maître espion, vous avez ordonné que je garde un oeil sur les affaires du château. J'en ai le cœur serré, mais le devoir m'oblige à vous révéler que votre fils {{folks.1.first_name}} a commit un... écart." Je me lève de ma table de travail et fronce les sourcils. "Un "écart"?."
{% if title.maitre_espion == folks.2 %}
Elle rougit un peu, et tire sur une mèche de cheveux comme elle le fait depuis qu'elle n'est qu'une enfant. Je ne me laisse pas attendrir, et sous mon regard autoritaire elle se décide à poursuivre. "Mon frère... je veux dire sire {{folks.1.first_name}} est tombé en affection de Marie, une des nouvelles servantes. Il l'a... euh... fréquenté en plusieurs occasion, à la nuit tombé." Elle me jette un regard suppliant? "Je vous en prie, ne soyez pas trop dur."
{% else %}
Regard embarrassé. "Le garçon a gagné les faveurs de Marie, une des nouvelles servantes. Si mes informations sont exactes, il partage sa couche tous les soirs ou presque."
{% endif %}

